// Navigation/Navigation.js
import * as React from 'react';

import { Image, View, ImageBackground } from 'react-native';
import { Icon } from 'react-native-elements';

import { createDrawerNavigator,
  DrawerContentScrollView,
  DrawerItemList,
  DrawerItem,
   } from '@react-navigation/drawer';


import LoginScreen from '../screens/LoginScreen';
import SignUp from '../screens/SignUpScreen';
import ForgottenPassword from '../screens/ForgottenPassword';
import ProductScreen from '../screens/ProductsScreen';
import HomeUnlog from './HomeUnlogNav';
import ShopScreen from '../screens/ShopScreen';
import AccessoriesScreen from '../screens/AccessoriesScreen';



import { translate } from "../locale/local";



const SideNavFree = createDrawerNavigator();
export default function DrawerUnlogNav({navigation}) {
  
  
  return (
    <SideNavFree.Navigator drawerContent={props => <CustomDrawerContent {...props} drawerType="slide"/>} >
      <SideNavFree.Screen name={translate("STACK_WELCOME")} component={HomeUnlog}/>
      <SideNavFree.Screen name={translate("STACK_ABOUT")} component={ProductScreen} />
      <SideNavFree.Screen name={translate("DRAWER_CUSTOM_CARETTE")} component={AccessoriesScreen} />
      <SideNavFree.Screen name={translate("DRAWER_SHOP")} component={ShopScreen} />
      <SideNavFree.Screen name={translate("STACK_SIGN_IN")} component={LoginScreen} />
      <SideNavFree.Screen name={translate("STACK_SIGN_UP")} component={SignUp} />
      <SideNavFree.Screen name={translate("STACK_FORGOTTEN_PASSWORD")} component={ForgottenPassword} options={{ drawerLabel: () => null}}/>
  </SideNavFree.Navigator>
  );
}


class CustomDrawerContent extends React.Component {
  constructor(props) {
    super(props)
    this.state={ Home: true,
                  About: false, 
                  Connexion: false,
                  Shop: false,
                  Inscription: false}
  }
  

  
  render() {

    return (
      <DrawerContentScrollView {...this.props}>
         <View style ={{height:150, display:'flex', justifyContent:"center",alignItems:'center', marginTop: -30}}>
           <ImageBackground blurRadius={3} source={image} style={{flex: 1, width: 300, justifyContent: 'center'}}>
              <Image source={require('../assets/images/carettev3white.png')} style={{height:100 , width:200, marginLeft:50}}></Image>
            </ImageBackground>
        </View>
        <View>
  
        <DrawerItem 
            icon={() => <Icon name='directions-bike' />} 
            label={translate("DRAWER_WELCOME")} 
            inactiveBackgroundColor={this.state.Home ? 'orange' : 'white'}
            onPress={ 
                      () => { this.setState({Home: true, About: false, Connexion: false, Inscription: false})
                              this.props.navigation.navigate(translate("STACK_WELCOME"))}} 
          />

        <DrawerItem 
            icon={() => <Icon name='face' />} 
            label={translate("DRAWER_ABOUT")}
            inactiveBackgroundColor={this.state.About ? 'orange' : 'white'}
            onPress={ 
                      () => { this.setState({Home: false, About: true, Connexion: false, Inscription: false})
                              this.props.navigation.navigate(translate("STACK_ABOUT"))}} 
          />

        <DrawerItem
         icon={() => <Icon  name='shop'/>} 
         label={translate("DRAWER_SHOP")}
         inactiveBackgroundColor={this.state.Shop ? 'orange' : 'white'}
         onPress={() => {this.setState({Home: false, About: false, Connexion: false, Inscription: false, Shop: true})
                         this.props.navigation.navigate(translate("DRAWER_SHOP"))}}/>
  
        <DrawerItem
          icon={() => <Icon  name='input' />} 
          label={translate("DRAWER_SIGN_IN")}
          inactiveBackgroundColor={this.state.Connexion ? 'orange' : 'white'}
          onPress={() => {this.setState({Home: false, About: false, Connexion: true, Inscription: false})
                          this.props.navigation.navigate(translate("STACK_SIGN_IN"))}}
        />
  
        <DrawerItem
          icon={() => <Icon name='get-app' />}
          label={translate("DRAWER_SIGN_UP")}
          inactiveBackgroundColor={this.state.Inscription ? 'orange' : 'white'}
          onPress={() => {this.setState({Home: false, About: false, Connexion: false, Inscription: true})
                          this.props.navigation.navigate(translate("STACK_SIGN_UP"))}}
        />
        
  
      </View>
  
      </DrawerContentScrollView>
    );
    }
  }
  




  const image = { uri: `data:image/jpeg;base64,` };